plot

The story is set in England and takes place mainly at a family home where Daniel (Matthew Macfadyen) and his wife Jane (Keeley Hawes) live with his parents. When the story opens, it is the day of Daniel's father's funeral and, while in the process of organizing this event, Daniel and Jane plan to purchase a flat and move away from the parental home. Daniel's brother Robert (Rupert Graves), a renowned novelist living in New York City, would rather spend his money on a First Class airline ticket to England than help finance the funeral, leaving Daniel to cover the burial expenses. As guests begin to arrive at the family home, where the funeral service is to be held, he struggles to complete a eulogy, although everyone expects Robert the writer will be the one to deliver some appropriate remarks.


